import React from 'react';

const CreateMatch = (props) => {
  const myTeam = 'Hapiol Patch Tikvwa'
  return (
    <div>
    <h1 style={{textAlign: 'center'}}>Create Match</h1>
  <label>
  <table>
    <tr>
      <td> {myTeam}</td>
      <td> <input type="text" ></input> </td>
    </tr>
  </table>
  </label>
    </div>
  );
};
export default CreateMatch;
